What is the output of the following recursive function in C?
#include <stdio.h>
int fun(int n) {
    if (n > 0) {
        return n + fun(n - 1);
    }
    return 0;
}
int main() {
   int a;
   int b;
   b = fun(5);
   print("%d\n", fun(5));
    return 0;
}

